const formData = [{
    labelName: "Name",
    typeInput: "text",
    placeholderInput: "e.g. Stephen King",
    formsClasses: "flex flex-col"
},
{
    labelName: "Address",
    typeInput: "email",
    placeholderInput: "e.g. stephenking@lorem.com",
},
{
    labelName: "Phone Number",
    typeInput: "tel",
    placeholderInput: "e.g. +1 234 567 890",
}]

export default formData
